import React, { useState } from 'react';
import '../pages/styles/veiw.css';

const Veiw = () => {
  const [content, setContent] = useState('ここに内容を表示');

  return (
    <div className="view-container">
      <p className="black-background">{content}</p>
    </div>
  );
};

export default Veiw;
